import { Component } from "react";
import Item from "../../components/cart-item/Item";

const tileData = ['test', 'test2'
];

class Home extends Component {

    render() {
        return (
            <div>
                <ul>
                    {
                        this.tileData.map(data => {
                            <li>{data}</li>
                        })
                    }
                </ul>
            </div>
        );
    }
}

export default Home;
